import { Typography } from "@mui/material";
import { Link } from "react-router-dom";
import Button from 'react-bootstrap/Button';
import "../App.css"
import "./Home.css"

const Home = () => {
  return (
    <div>
      <Typography sx={{ margin:"5%" }} variant="h3" align="center">
        LPU Club Hiring
      </Typography>
      <div>
        <ul className="ul PathUL">
          <li>
          <Button sx={{ margin:"2% 3%"}} className="hiringBtn" variant="success">
            <Link to="/employer/dashboard">
              Hire Amazing talent
            </Link>
            </Button>
          </li>
          <li>
          <Button size="lg" className="hiringBtn" variant="success">
          {/* <Button variant="success"> */}
            <Link to="/employee/feed">
              Club Opening
            </Link>
            </Button>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Home;
